Reclaiming Russia's Paradise

Sociopolitical Documentary hosted by Lucy Ash, published by BBC broadcasted as part of BBC Our World series in 2014 - English narration


Information
------------------------------

Vladimir Putin may have angered the international community by snatching Crimea from Ukraine this spring, but opinion polls show that nearly 80 percent of Russians approve of the move. It's hard to overstate the importance of this Black Sea peninsula in the Russian psyche. The region was originally conquered by Catherine the Great's favourite general who said &quot;Russia needs its paradise.&quot; But now millions of Ukrainian and foreign tourists are staying away. The Russian government is trying to fill the gap by urging employers to send staff on subsidised breaks in Crimea. A holiday in the newly annexed peninsula has become every Russian's patriotic duty. For Our World Lucy Ash has been to meet tourists and locals in Yalta, one of Crimea's busiest resorts.

